import React, { Fragment } from "react";
import { Form, Input, Layout, Typography } from "antd";
import MenuFooter from "../custom/footer";

const layout = {
  labelCol: {
    span: 8
  },
  wrapperCol: {
    span: 5
  }
};
const RememberPassword = () => {
  return (
    <Fragment>
      <Layout.Content style={{ margin: "22em 16px" }}>
        <div
          style={{
            background: "#fff",
            padding: 44,
            minHeight: 280,
            minWidth: 10
          }}
        >
          <Form hideRequiredMark {...layout}>
            <Form.Item
              name="email"
              label="Email"
              rules={[
                { required: true, type: "email", message: "Enter email" }
              ]}
            >
              <Input />
            </Form.Item>
          </Form>
        </div>
      </Layout.Content>
      <MenuFooter />
    </Fragment>
  );
};

export default RememberPassword;
